import React from 'react';
import TaskList from './taskList'; // Modify to use the relevant list logic

const Trash = ({ tasks }) => {
  const trashedTasks = tasks.filter(task => task.trashed);

  return (
    <div>
      <h1>Trash</h1>
      <TaskList tasks={trashedTasks} />
    </div>
  );
};

export default Trash;
